  names v8 v8_g
  paths ${v8_root}
  no_default_path
  )

find_library(boost_${uppercomponent}_library_release
        names  libboost_${component}${_boost_compiler}-${boost_lib_version}
               libboost_${component}${_boost_compiler}-s-${boost_lib_version}
	       libboost_${component}-gcc${_boost_compiler_version}-${boost_lib_version}
