               libboost_${component}-s
               libboost_${component}
        paths  ${_boost_libraries_search_dirs}
        no_default_path
    )

find_library(boost_${uppercomponent}_library_debug
        names  libboost_${component}${_boost_compiler}-${_boost_abi_tag}-${boost_lib_version}
