               libboost_${component}-gcc${_boost_compiler_version}-${_boost_abi_tag}-${boost_lib_version}
               libboost_${component}-gcc${_boost_compiler_version}-s${_boost_abi_tag}-${boost_lib_version}
               libboost_${component}-${_boost_abi_tag}
               libboost_${component}-s${_boost_abi_tag}
               libboost_${component}-${_boost_abi_tag}
        paths  ${_boost_libraries_search_dirs}
        no_default_path
    )
